selector .pp-button {
    position: relative;
}
selector .pp-buttons-icon-wrapper {
    position: absolute;
    right: 50px;
    opacity: 0;
    transition: all .2s
}
selector .pp-button:hover .pp-buttons-icon-wrapper {
    right: 15px;
    opacity: 1;
}

selector .pp-button-content-wrapper {
    position: relative;
}
