        filter: opacity(50%);
    backface-visibility: hidden;
    box-shadow: 0px 2px 18px 0px rgba(0,0,0,0.3);
    transform: scaleX(0.9) scaleY(0.9);
    transition: transform 300ms ease 0ms,filter 300ms ease 0ms;
}
